import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';

// Import all the components used in the application.
import { AppComponent } from './app.component';
import { AppRoutingModule } from './app-routing.module';
import { CreateAlbumComponent } from './create-album/create-album.component';
import { DeleteAlbumComponent } from './delete-album/delete-album.component';
import { DisplayAlbumComponent } from './display-album/display-album.component';
// Ensure the path to the EditAlbumComponent is correct and it's properly exported.
import { EditAlbumComponent } from './edit-album/edit-album.component';

// Other components part of the application.
import { ListAlbumsComponent } from './list-albums/list-albums.component';
import { ListArtistsComponent } from './list-artists/list-artists.component';
import { HttpClientModule } from '@angular/common/http';

// The @NgModule decorator marks this class as an Angular module with metadata about components and imports.
@NgModule({
	declarations: [
		// Declare all components so Angular knows about them.
		AppComponent,
		CreateAlbumComponent,
		DeleteAlbumComponent,
		DisplayAlbumComponent,
		EditAlbumComponent,
		ListAlbumsComponent,
		ListArtistsComponent,

	],
	imports: [
		// AppRoutingModule must be imported to set up application routing.
		AppRoutingModule,
		// BrowserModule must be imported for running the app in the browser.
		BrowserModule,
		// FormsModule is imported if you're using template-driven forms.
		FormsModule,
		// ReactiveFormsModule is imported if you're using reactive forms.
		ReactiveFormsModule,
		// Add HttpClientModule here
		HttpClientModule, 
	],
	providers: [],
	// The bootstrap array tells Angular which component to bootstrap, usually the root component.
	bootstrap: [AppComponent]
})
export class AppModule { }
